#FollowMeTo the Moscow Industry, Electrozavod factory. 

#СледуйЗаМной на московский Электрозавод. 

Вместе с @otkroy_mosprom открыли выставку #FollowMeTo the Moscow Industry на Арбате, 
посвящённую эстетике столичных промпредприятий. Электрозавод – одна из локаций, на которой мы постарались передать энергию промышленных объектов и найти красоту там, где её могут не заметить с первого раза. 

Приходите посмотреть фотовыставку до 30 июня на Арбат и с 1 по 31 июля на Цветной Бульвар :) вместе с нами в проекте приняли участие 8 очень талантливых фотографов.

